import React from "react";
import "bootstrap/dist/css/bootstrap.min.css"; // Ensure Bootstrap CSS is imported
import logo from "./assets/logo.png";
import animals from "./assets/animals.png";
import protection from "./assets/protection.png";
import lungs from "./assets/lungs.png";
import food from "./assets/food.png";
import mind from "./assets/mind.png";
import doge from "./assets/vetdoge.jpg";
import tic from "./assets/tic.png";
import "./App.css";

// Data for the feature cards
const features = [
  {
    img: protection,
    title: "Защита от зарази",
    description:
      "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus.",
  },
  {
    img: lungs,
    title: "100% възтановяване",
    description:
      "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus.",
    highlighted: true,
  },
  {
    img: food,
    title: "Натурални съставки",
    description:
      "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus.",
  },
  {
    img: mind,
    title: "Без травми",
    description:
      "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus.",
  },
];

// Data for the benefits list
const benefits = [
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
];

function App() {
  return (
    <div className="container-fluid p-0 overflow-hidden">
      {/* Header section with a background image as a full-width image */}
      <div className="row justify-content-center align-items-center animals-sec border-5 border-bottom border-primary">
        <div className="col-12 p-0 d-flex justify-content-center align-items-center position-relative">
          <img
            src={animals}
            alt="Background"
            className="w-100 img-fluid"
          />
        </div>
      </div>

      {/* Logo section */}
      <div className="row justify-content-center py-3">
        <div className="col-md-6 text-center">
          <img
            src={logo}
            alt="Bio Logo"
            className="w-50 img-fluid"
          />
        </div>
      </div>

      {/* Main text */}
      <div className="row">
        <div className="col-12 text-center">
          <h1 className="display-1 pb-5" style={{ fontFamily: "'Lobster', cursive" }}>
            Грижим се за тяхното здраве
          </h1>
        </div>
      </div>

      {/* Feature cards section */}
      <div className="row justify-content-center p-5 mx-0">
        {features.map((feature, index) => (
          <div key={index} className="col-12 col-md-6 col-lg-3 mb-4">
            <div
              className={`card p-3 border rounded ${
                feature.highlighted ? "bg-primary text-white" : "bg-light"
              }`}
            >
              <img
                src={feature.img}
                alt={`${feature.title} Icon`}
                className="card-img-top img-fluid mb-2 mx-auto"
                style={{ maxWidth: "92px", maxHeight: "92px", objectFit: "cover" }}
              />
              <div className="card-body">
                <h5 className="card-title fs-4 fw-bold">{feature.title}</h5>
                <p className="card-text fs-6">{feature.description}</p>
              </div>
            </div>
          </div>
        ))}
      </div>

      {/* Choose us section */}
      <div className="row py-5 mx-0 mb-5 mt-5">
        <div className="col-md-6 mb-4 mb-md-0">
          <img
            src={doge}
            alt="Decorative"
            className="img-fluid rounded border border-0"
            style={{ borderRadius: "10px" }}
          />
        </div>
        <div className="col-md-6">
          <h1 className="display-4 fw-bold pb-3">Защо да изберете нас?</h1>
          <ul className="list-unstyled">
            {benefits.map((benefit, index) => (
              <li key={index} className="d-flex align-items-center mb-3 fs-6">
                <img src={tic} alt="Check" className="me-2" />
                {benefit}
              </li>
            ))}
          </ul>
          <a
            href="#"
            className="btn btn-link fs-6 fw-medium text-primary"
          >
          </a>
        </div>
      </div>
      <div className="container-fluid p-5" style={{ backgroundColor: '#E8F0FF'}}>
        <div className="row">
          <div className="col-md-6">
            <h1 style={{ fontWeight: '700', fontSize: '48px', lineHeight: '62.4px', color: '#2e2e2eff' }}>
              Какво <span style={{ color: '#007bff' }}>Казват Клиентите</span> За Нас?
            </h1>
            <p style={{ fontSize: '16px', lineHeight: '20.8px', color: '#2e2e2eff' }}>
              Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus.
            </p>
            <div className="d-flex align-items-center">
              {[7, 8, 9, 10, 11, 12].map(id => (
                <img key={id} src={`https://placeholder.pics/svg?${id}`} alt="avatar" className="rounded-circle" style={{ width: '52px', height: '52px', marginRight: '5px' }} />
              ))}
              <span style={{ fontWeight: '600', marginLeft: '10px', fontSize: '16px', color: '#2e2e2eff' }}>100+ Reviews</span>
            </div>
          </div>
          <div className="col-md-6">
            <div className="card" style={{ borderRadius: '10px' }}>
              <div className="card-body">
                <div className="d-flex align-items-center mb-3">
                  <img src="https://dashboard.codeparrot.ai/api/assets/Z0zDg3FEV176CUiG" alt="avatar" className="rounded-circle" style={{ width: '52px', height: '52px', marginRight: '10px' }} />
                  <div>
                    <h5 className="mb-0" style={{ fontWeight: '600', fontSize: '16px', color: '#2e2e2eff' }}>Жени Мирчева</h5>
                    <small style={{ fontSize: '12px', color: '#2e2e2eff' }}>13/11/2024</small>
                  </div>
                  <div className="ms-auto">
                    {[1, 2, 3, 4, 5].map(star => (
                      <span key={star} className="text-warning" style={{ fontSize: '40px' }}>★</span>
                    ))}
                  </div>
                </div>
                <p style={{ fontSize: '16px', lineHeight: '20.8px', color: '#2e2e2eff' }}>
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus.
                </p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
